import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
let name="HARSH";
let img1='https://picsum.photos/id/237/200/300';
let img2="https://picsum.photos/seed/picsum/200/300";
const root = ReactDOM.createRoot(document.getElementById("root"));
const obj={
  color:"#fa9191",
  textAlign:"center",
  textTransform:"capatilize",
  fontWeight:"bold",
  textShadow:0+"px" + 2+"px" + 4+"px" + "#ff9c5",
  margin:70+"px" + 0,
  fontFamily
}
root.render(<>
  <h1 style={obj}>MY NAME IS {name}</h1> 
  <img src={img1} alt="this is random image"/>
  <img src={img2} alt="this is not your image"/>
</>);
